let player;
let frame = 0;
let cameraPosition;

function BOOT() {
	player = new Player();
	player.setPosition(new Vector2(55, 50));
	cameraPosition = Vector2.zero();
}

function TIC() {
	// UPDATE
	player.update();

	// DRAW
	const { x, y } = cameraPosition.sub(new Vector2(120, 68));
	cls(12)
	map(x >> 3, y >> 3, 31, 18, -(x % 8), -(y % 8), -1);
	player.draw();

	frame++;
}

class Player {
	constructor() {
		this.setPosition(Vector2.zero());
		this.lastMovedFrame = -Infinity;
		this.moveDelay = 16;
	}

	setPosition(position) {
		this.position = position;
		this.displayPosition = this.position.mul(8);
	}

	update() {
		const targetDisplayPosition = this.position.mul(8);
		this.displayPosition = this.displayPosition.moveTo(targetDisplayPosition, 1);
		cameraPosition = this.displayPosition.add(new Vector2(8, 8));
		this.control();
	}

	draw() {
		rect(113, 61, 14, 14, 12);
	}

	control() {
		if (this.lastMovedFrame + this.moveDelay <= frame) {
			if (btn(0) && btn(2)) this.moveUpLeft();
			else if (btn(1) && btn(3)) this.moveDownRight();
			else if (btn(2) && btn(1)) this.moveLeftDown();
			else if (btn(3) && btn(0)) this.moveRightUp();
			else if (btn(0)) this.moveUp();
			else if (btn(1)) this.moveDown();
			else if (btn(2)) this.moveLeft();
			else if (btn(3)) this.moveRight();
		}
	}

	moveUpLeft() {
		if (this.getNeighbourFlag(0, -1, 0) || this.getNeighbourFlag(1, -1, 0)) {
			this.moveLeft();
			this.moveUp();
		} else {
			this.moveUp();
			this.moveLeft();
		}
	}

	moveDownRight() {
		if (this.getNeighbourFlag(0, 2, 0) || this.getNeighbourFlag(1, 2, 0)) {
			this.moveRight();
			this.moveDown();
		} else {
			this.moveDown();
			this.moveRight();
		}
	}

	moveLeftDown() {
		if (this.getNeighbourFlag(-1, 0, 0) || this.getNeighbourFlag(-1, 1, 0)) {
			this.moveDown();
			this.moveLeft();
		} else {
			this.moveLeft();
			this.moveDown();
		}
	}

	moveRightUp() {
		if (this.getNeighbourFlag(2, 0, 0) || this.getNeighbourFlag(2, 1, 0)) {
			this.moveUp();
			this.moveRight();
		} else {
			this.moveRight();
			this.moveUp();
		}
	}

	moveUp() {
		if (this.getNeighbourFlag(0, -1, 0) || this.getNeighbourFlag(1, -1, 0)) return;
		this.position.y--;
		this.lastMovedFrame = frame;
	}

	moveDown() {
		if (this.getNeighbourFlag(0, 2, 0) || this.getNeighbourFlag(1, 2, 0)) return;
		this.position.y++;
		this.lastMovedFrame = frame;
	}

	moveLeft() {
		if (this.getNeighbourFlag(-1, 0, 0) || this.getNeighbourFlag(-1, 1, 0)) return;
		this.position.x--;
		this.lastMovedFrame = frame;
	}

	moveRight() {
		if (this.getNeighbourFlag(2, 0, 0) || this.getNeighbourFlag(2, 1, 0)) return;
		this.position.x++;
		this.lastMovedFrame = frame;
	}

	getNeighbourFlag(offsetX, offsetY, flag) {
		let { x, y } = this.position.add(new Vector2(offsetX, offsetY));
		return fget(mget(x, y), flag);
	}
}

class Vector2 {
	static zero() {
		return new Vector2(0, 0);
	}

	constructor(x = 0, y = 0) {
		this.x = x;
		this.y = y;
	}

	add(vector) {
		return new Vector2(this.x + vector.x, this.y + vector.y);
	}

	sub(vector) {
		return new Vector2(this.x - vector.x, this.y - vector.y);
	}

	mul(scaler) {
		return new Vector2(this.x * scaler, this.y * scaler);
	}

	moveTo(vector, step) {
		return new Vector2(
			moveTo(this.x, vector.x, step),
			moveTo(this.y, vector.y, step));
	}
}

function moveTo(start, end, step) {
	let differance = end - start;
	differance = Math.sign(differance) * step;
	return start + differance;
}

